import React from "react";
import "./AppContent.css";

import {BrowserRouter as Router,Route} from "react-router-dom";

// import ErrorView from "../AppContent/Error404/Error404";
import HomeView from "../AppContent/HomeView/HomeView";
// import ShopView from "../AppContent/ShopView/ShopView";
import LoginView from "../AppContent/Forms/LoginView/LoginView";
import RegisterView from "../AppContent/Forms/RegisterView/RegisterView";

const AppContent = function (props) {
    const route = props.route;
    if(route === "home"){
        return (<HomeView />);
    }
    // if(route === "shop"){
    //     return (<ShopView />);
    // }
    if(route === "login"){
        return (<LoginView />);
    }
    if(route === "register"){
        return (<RegisterView />);
    }
    // return (<ErrorView/>);
    return (
        <Router>
            <Route path="/" component={HomeView}/>
        </Router>
    );
}

export default AppContent;
